import React from "react";
import Comment from "./Comment";

const CommentList = ({ currentUser, comments }) => {
  return (
    <>
      {comments.map((comment) => (
        <Comment key={comment.id} comment={comment} currentUser={currentUser} />
      ))}
    </>
  );
};

export default CommentList;
